HAL_StatusTypeDef bq34z100_dfi_fullAccess(void)
{
  HAL_StatusTypeDef result = HAL_ERROR;
  uint16_t status;
  uint8_t retry = 0;
  uint8_t pData[2];

    /*Before full access is enabled, unsealed mode must be enabled*/
    result = bq34z100g1_unsealed();
    if (result != HAL_OK)
      return result;

    while(retry < 3)
    {
        pData[0] = 0xFF;
        pData[1] = 0xFF;
        /*send first 2 bytes of Full Access key using Control(0xFFFF)*/
        result = HAL_I2C_Mem_Write(I2C_BMS, BQ34Z100_G1_ADDRESS, 0x00, 1, pData, 2, 1000);
        if (result != HAL_OK)
          return result;

        /*send second 2 bytes of Full Access key using Control(0xFFFF)*/
        result = HAL_I2C_Mem_Write(I2C_BMS, BQ34Z100_G1_ADDRESS, 0x00, 1, pData, 2, 1000); //send last 2 bytes of Full Access key using Control(0xFFFF)
        if (result != HAL_OK)
          return result;

        HAL_Delay(100);
        /*Check for FAS bit clear in the Status Register*/
        status = bq34z100g1_read_control(0x00);
        if((status & (1<<FAS)) == 0)
        {
          retry = 0;
          result = HAL_OK;
          break;
        }
        else
        {
          retry++;
          result = HAL_ERROR;
        }
    }
  return result;
}


