{
  HAL_StatusTypeDef result = HAL_ERROR;
  uint8_t pData[2];
  pData[0] = 0x00;
  pData[1] = 0x0F;
  result = HAL_I2C_Mem_Write(I2C_BMS, BQ34Z100_G1_ADDRESS, 0x00, 1, pData, 2, 1000); //enter ROM mode
  //HAL_Delay(400);
  return result;
}

HAL_StatusTypeDef bq34z100_dfi_exit_romMode(void)
{
  HAL_StatusTypeDef result = HAL_ERROR;
  uint8_t pData[1] = {0x0F};
  uint8_t checksum[2] = {0x0F, 0x00};
  result = HAL_I2C_Mem_Write(I2C_BMS, BQ34Z100_DFI, 0x00, 1, pData, 1, 1000); //exit ROM mode
  result = HAL_I2C_Mem_Write(I2C_BMS, BQ34Z100_DFI, 0x64, 1, checksum, 2, 1000); //exit ROM mode chechsum
  //HAL_Delay(400);
  return result;
}

