    checksum = /*checksum +*/ bq34z100_dfi_calculate_checksum(hbq34z100_DFI.DataFlashImmage[row], sizeof(hbq34z100_DFI.DataFlashImmage[row]));
    pChecksum[0] = (checksum & 0xFF);
